import React from "react";
import '../styles/Home.css';
import logoIcon from '../Images/ai.png'
function Home() {
  return (
    <>
      <div className="main__container">
        <div className="chat__container">
          <div className="header__container">
            <img src={logoIcon}/>    
        </div>
        </div>
      </div>
    </>
  );
}

export default Home;
